import React from 'react'
import Logo from './img/logo.svg'

const Nav = () => {
  return (
    <div>
      <img src={Logo} alt='logo' />
      <div />
      <div>
        <ul>
          <li>Home</li>
          <li>Destination</li>
          <li>Crew</li>
          <li>Technology</li>
          <NavComponent number='01' name='home' />
        </ul>
      </div>
    </div>
  )
}

const NavComponent = (props) => {
  return (
    <li>
      <span>{props.number}</span>
      {props.name}
    </li>
  )
}

export default Nav
